import React, {Component} from 'react';
import './Deckcard.css';
import styled from 'styled-components';

class DeckCard extends Component {
    constructor(props) {
        super(props)
        this.state = {
            localDeckName: this.props.deckName
        }
    }

    shouldComponentUpdate(nextProps, nextState){
        return (this.props.items[0] !== nextProps.items[0]);
    }


    render() {
        return (
            <div className = "DeckCard">
                <div className="DeckCardInner">
                    <div className="DeckDot"></div>
                    <div className="DeckName" data-testid="DeckName" onClick={this.props.study}>{this.state.localDeckName}</div>
                    <button className="DownloadButton" src={`./DownloadButton.png`} onClick={this.props.download}></button>
                </div>
            </div>
        )
    }
}




export default DeckCard
